import React from "react";

const RequestPostPage: React.FC = () => {
  return (
    <React.Fragment>
      <form className="post-form-container">
        <input type="text" className="post-form-input" id="title" required />
      </form>
    </React.Fragment>
  );
};

export default RequestPostPage;
